import React, {Component} from 'react';
export default class News extends Component {
    render(){
        return (
            <div className='border-bottom border-top padding-sm relative'>
                <div className='text'>
                    <div id='rssBlock'>
                        <p class="cnnContents">
                            <div class="marqueeStyle">&nbsp;Invited Talk at GyeongGi Cultural Foundation in Korea.</div>
                            <div class="marqueeStyle">&nbsp;Invited Talk and Workshop at San Jose State University</div>
                            <div class="marqueeStyle">&nbsp;Juror for PacificVis 2022</div>
                        </p>
                    </div>
                </div>
            </div>
        )
    }
}
